    // (0l)
    // >>> fizzBuzz((78l))
    // (2l)
    // >>> fizzBuzz((79l))
    // (3l)
    public static long fizzBuzz(long n) {
        long count = 0;
        for (long i = 1; i < n; i++) {
            if (i % 11 == 0 || i % 13 == 0) {
                String num = Long.toString(i);
                for (char c : num.toCharArray()) {
                    if (c == '7') {
                        count++;
                        break;
                    }
                }
            }
        }
        return count;

