    // (new ArrayList<String>(Arrays.asList((String)"4")))
    public static ArrayList<String> totalMatch(ArrayList<String> lst1, ArrayList<String> lst2) {
        int lst1Chars = lst1.stream().mapToInt(String::length).sum();
        int lst2Chars = lst2.stream().mapToInt(String::length).sum();
        if (lst1Chars < lst2Chars) {
            return lst1;
        } else {
            return lst2;
        }

