        ArrayList<String> letterGrades = new ArrayList<>();
        for (Float g : grades) {
            if (g == 4.0f) {
                letterGrades.add("A+");
            } else if (g > 3.7f) {
                letterGrades.add("A");
            } else if (g > 3.3f) {
                letterGrades.add("A-");
            } else if (g > 3.0f) {
                letterGrades.add("B+");
            } else if (g > 2.7f) {
                letterGrades.add("B");
            } else if (g > 2.3f) {
                letterGrades.add("B-");
            } else if (g > 2.0f) {
