                letterGrades.add("C-");
            } else if (g > 1.0f) {
                letterGrades.add("D+");
            } else if (g > 0.7f) {
                letterGrades.add("D");
            } else if (g > 0.0f) {
                letterGrades.add("D-");
            } else {
                letterGrades.add("E");
            }
        }
        return letterGrades;

