        String s2 = lst.get(1);
        int count = 0;
        for (char c : s1.toCharArray()) {
            if (c == '(') {
                count++;
            } else {
                count--;
            }
        }
        for (char c : s2.toCharArray()) {
            if (c == '(') {
                count++;
            } else {
                count--;
            }
        }
        if (count == 0) {
            return "Yes";
        } else {
            return "No";
        }

