    // (false)
    public static boolean isSorted(ArrayList<Long> lst) {
        // Check if list is sorted
        boolean sorted = IntStream.range(0, lst.size() - 1).allMatch(i -> lst.get(i) <= lst.get(i + 1));
        // Check if list has more than 1 duplicate
        boolean duplicates = lst.stream().distinct().count() != lst.size();
        // Return whether list is sorted and has no duplicates
        return sorted && !duplicates;

