    // Return 0 if all digits are even.
    // For example:
    // >>> digits((1l))
    // (1l)
    // >>> digits((4l))
    // (0l)
    // >>> digits((235l))
    // (15l)
    public static long digits(long n) {
        String num = Long.toString(n);
        List<Long> oddDigits = new ArrayList<>();
        for (int i = 0; i < num.length(); i++) {
            int digit = Integer.parseInt(String.valueOf(num.charAt(i)));
            if (digit % 2 != 0) {
                oddDigits.add((long) digit);
            }
        }
        if (oddDigits.isEmpty()) {
            return 0;
        }
        return oddDigits.stream().reduce(1, (a, b) -> a * b);

