            a.add(i * i - i + 1);
        }
        long count = 0;
        for (long i = 0; i < n - 2; i++) {
            for (long j = i + 1; j < n - 1; j++) {
                for (long k = j + 1; k < n; k++) {
                    if ((a.get(i) + a.get(j) + a.get(k)) % 3 == 0) {
                        count++;
                    }
                }
            }
        }
        return count;

